const validate= (userData,setErrors,errors) => {

    if(!userData.username){
        setErrors({ ...errors,
            username: 'EL EMAIL ESTA VACIO'
        })
    } else if(userData.username.length > 35){
        setErrors({ ...errors,
        username: 'CONTIENE DEMASIADOS CARACTERES'})
    }
}

export default validate
